package com.example.programs;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.PrintWriter;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashMap;
import java.util.HashSet;
import java.util.InputMismatchException;
import java.util.LinkedList;

public class LongestDuplicateSubstring {
	InputStream is;
	PrintWriter out;
	String INPUT = "";

	public static void main(String[] args) throws Exception {
		new LongestDuplicateSubstring().run();
	}

	void run() throws Exception {
		is = INPUT.isEmpty() ? System.in : new ByteArrayInputStream(INPUT.getBytes());
		out = new PrintWriter(System.out);
		long s = System.currentTimeMillis();
		solve();
		out.flush();
		if (!INPUT.isEmpty())
			tr(System.currentTimeMillis() - s + "ms");
	}

	void solve() {
		for (int T = ni(); T > 0; T--) {
			out.print(longestDupSubstring(
					""));
		}
	}

	long p = 10000007;
	String ans = "";

	public String longestDupSubstring(String S) {

		if (S.length() == 0)
			return "";

		String temp = ans;
		long[] roll = new long[S.length()];
		roll[0] = 1;
		for (int i = 1; i < S.length(); i++)
			roll[i] = (roll[i - 1] * 26) % p;
		int low = 1;
		int high = S.length();
		while (low <= high) {
			int mid = (low + high) / 2;
			boolean res = match(S, S.length(), mid, roll);
			if (res) {
				if (ans.length() > temp.length()) {
					temp = ans;
				}
				low = mid + 1;
			} else
				high = mid - 1;
		}
		return temp;
	}

	public boolean match(String s, int len, int size, long[] roll) {
		HashMap<Long, ArrayList<Integer>> map = new HashMap<Long, ArrayList<Integer>>();
		long hash = 0;
		// first window hash
		for (int i = 0; i < size; i++) {
			hash = (hash * 26 + (s.charAt(i) - 'a')) % p;
		}
		ArrayList<Integer> ele = new ArrayList<Integer>();
		ele.add(0);
		map.put(hash, ele);

		for (int i = size; i < len; i++) {
			hash = ((hash - roll[size - 1] * (s.charAt(i - size) - 'a')) % p + p) % p;
			hash = (hash * 26 + (s.charAt(i) - 'a')) % p;
			if (map.containsKey(hash)) {
				for (Integer a : map.get(hash)) {
					String first = s.substring(a, a + size);
					String second = s.substring(i - size + 1, i - size + 1 + size);
					if (first.equals(second)) {
						ans = first;
						return true;
					}
				}
				map.get(hash).add(i - size + 1);
			} else {
				ArrayList<Integer> temp = new ArrayList<Integer>();
				temp.add(i - size + 1);
				map.put(hash, temp);
			}
		}
		return false;
	}

	private byte[] inbuf = new byte[1024];
	public int lenbuf = 0, ptrbuf = 0;

	private int readByte() {
		if (lenbuf == -1)
			throw new InputMismatchException();
		if (ptrbuf >= lenbuf) {
			ptrbuf = 0;
			try {
				lenbuf = is.read(inbuf);
			} catch (IOException e) {
				throw new InputMismatchException();
			}
			if (lenbuf <= 0)
				return -1;
		}
		return inbuf[ptrbuf++];
	}

	private boolean isSpaceChar(int c) {
		return !(c >= 33 && c <= 126);
	}

	private int skip() {
		int b;
		while ((b = readByte()) != -1 && isSpaceChar(b))
			;
		return b;
	}

	private double nd() {
		return Double.parseDouble(ns());
	}

	private char nc() {
		return (char) skip();
	}

	private String ns() {
		int b = skip();
		StringBuilder sb = new StringBuilder();
		while (!(isSpaceChar(b))) { // when nextLine, (isSpaceChar(b) && b != ' ')
			sb.appendCodePoint(b);
			b = readByte();
		}
		return sb.toString();
	}

	private char[] ns(int n) {
		char[] buf = new char[n];
		int b = skip(), p = 0;
		while (p < n && !(isSpaceChar(b))) {
			buf[p++] = (char) b;
			b = readByte();
		}
		return n == p ? buf : Arrays.copyOf(buf, p);
	}

	private char[][] nm(int n, int m) {
		char[][] map = new char[n][];
		for (int i = 0; i < n; i++)
			map[i] = ns(m);
		return map;
	}

	private int[] na(int n) {
		int[] a = new int[n];
		for (int i = 0; i < n; i++)
			a[i] = ni();
		return a;
	}

	private long[] nl(int n) {
		long[] a = new long[n];
		for (int i = 0; i < n; i++)
			a[i] = nl();
		return a;
	}

	private int ni() {
		int num = 0, b;
		boolean minus = false;
		while ((b = readByte()) != -1 && !((b >= '0' && b <= '9') || b == '-'))
			;
		if (b == '-') {
			minus = true;
			b = readByte();
		}

		while (true) {
			if (b >= '0' && b <= '9') {
				num = num * 10 + (b - '0');
			} else {
				return minus ? -num : num;
			}
			b = readByte();
		}
	}

	private long nl() {
		long num = 0;
		int b;
		boolean minus = false;
		while ((b = readByte()) != -1 && !((b >= '0' && b <= '9') || b == '-'))
			;
		if (b == '-') {
			minus = true;
			b = readByte();
		}

		while (true) {
			if (b >= '0' && b <= '9') {
				num = num * 10 + (b - '0');
			} else {
				return minus ? -num : num;
			}
			b = readByte();
		}
	}

	private void tr(Object... o) {
		if (INPUT.length() > 0)
			System.out.println(Arrays.deepToString(o));
	}
}
